import React from "react";
import Employment from "../components/Employment"
import Footer from "../components/Footer";
import { Link, animateScroll as scroll } from "react-scroll";
import ProgressBar from "react-scroll-progress-bar";

import Page from '../layouts/page.js';



const EmploymentPage = () => {

  const data = [
    {
      to: 'edgreeStatistics',
      text: 'Statistics'
    },
    {
      to:"employerSection",
      text:"Employers"
    },
    {
      to:"careers",
      text:"Careers"
    },
    {
      to:"coopTable",
      text:"Coops"
    },
    {
      to:"employmentTable",
      text:"Employment"
    },
    {
      to:"employerMap",
      text:"Employer Map"
    },

  ]

  return (<div>

      <ProgressBar bgcolor="#F76902"/>

      <div id="nav"> 
        {
          data.map((item) => (
          <Link activeClass="activeS" className="newItem" smooth spy to={data.to}>{data.text}</Link>
        ))}
      </div>


      <div className='pageTitle'>
        <h1>Employment</h1>
      </div>

      <Employment/>

      <Footer/>

    </div>

  );
};

export default EmploymentPage;
